import React from 'react'
import MenuList from './MenuList';

const SelectedItem = props => {

    const [menuId] = props.match.menuId;

    return (
        <React.Fragment>
            {MenuList.list[menuId]}
        </React.Fragment>
    )
}

export default SelectedItem;
